import React from "react";

class Recipe{
    constructor(props) {
        this.render();
    }

    state = {
        total_elements: true,
        recipe_name: null,
        cuisine: null,
        ingredients: null,
        final_image: null,
        instructions: null
    }

    componentDidMount() {
        fetch('https://api.randomuser.me/')
        .then(response => response.json())
        .then(data => console.log(data));
    }

    render() {
        const data = this.componentDidMount();
        return (
             <div> 
                <h1> {this.state.recipe_name} </h1>
                <p> {data} </p>
            </div>
        );
    }
}

export default Recipe;
